import React from "react";

import TasksList from "../components/TasksList";

const AllTasks = () => {
    const TASKS = [
        {
          taskId : 't1', 
          creator : 'Ananya Gupta', 
          taskDesc : 'Study JavaScript',
          creatorId: 'c1'                
       }
   ];
    return (
     <React.Fragment>
        <h2>Welcome to Personalize TO-DO List</h2>
        <TaskList items = {TASKS} />
     </React.Fragment>   
    );
};

export default AllTasks;
